import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { ServiceCallsService } from 'src/app/services/service-calls.service';

@Component({
  selector: 'app-application',
  templateUrl: './application.component.html',
  styleUrls: ['./application.component.css']
})
export class ApplicationComponent implements OnInit {
  customerid:any
  data:any;
  public customerData:any;
  constructor(private router:Router, private route:ActivatedRoute, private service:ServiceCallsService) { }

  async ngOnInit(): Promise<void> {
    const applictaionRespone = await this.service.applicationById(Number.parseInt(this.route.snapshot.paramMap.get("id")!));
    this.data = applictaionRespone;
    console.log(this.data);
    this.customerid = Number.parseInt(applictaionRespone.application['applicationId']);
    console.log(this.customerid)
    this.customerData = await this.service.customerData(this.customerid);
  }

}

  <style>
      .one{
           position:relative;
          margin-left:27%;
       }       
      .two{
         flex-direction: column;
      } 
      .two label {
           margin: 20px 20px 20px 20px;
     }
     .demo1{
          width: 480px;
          height: 330px;
          border: 1px solid black;
          float:right;
          line-height: 1.2;
          padding:3px;
     }
     .demo1 label{
         margin: 10px 40px 40px 40px;
     }
     .demo2{
         width: 480px;
           height: 260px;
           border: 1px solid black;
         float:right;
         line-height: 1.2;
         padding:3px;

     }.demo2 label{
         margin: 10px 40px 40px 40px;
     }
     .demo3{
         width: 300px;
           height: 109px;
           border: 1px solid black;
         padding: 3px;
         box-sizing: border-box;
         float:left;
         position:relative; left:10px; 
     }
     .demo3label{
     float:left;
     }
     .demo4{
         width: 850px;
         height: 365px;
         border: 1px solid black;
         padding: 3px;
         line-height: 0.5;
         float:right;
         position:relative; left:35px; top:47px;
     }.demo4 label{
         margin: 10px 45px 30px 45px;
     }

  </style>


<div class="one">
     Application ID :  {{data?.applicationId}}<br/>
     Application Status : {{data?.applicationStatus}}<br/>
     Score : {{data?.score}}<br/>
     Decline Reason : {{data?.declineReason}}<br/>            
</div>

<h3>Original Application</h3>
<hr height="2px">
<br/>
<div >
 <form class="two" >
