           <input type="text" value="{{customerData?.address.state}}" readonly>
         <br/>
         <label>Postal Code </label>
           <input type="text" value="{{customerData?.address.postalCode}}" readonly>
      </span> 
      <br/> <br/>
       <label>Middle Name </label>  
           <input type="text" value="{{customerData?.middleName}}" readonly>
      <br/><br/>
     <label>Last Name </label>
           <input type="text" value="{{customerData?.lastName}}" readonly>  
     <br/><br/>    
       <label>Date of Birth </label>  
           <input type="date" value="{{customerData?.dateOfBirth}}" readonly >
      <br/><br/> 
      <label>Marital Status </label>
           <input type="text" value="{{customerData?.maritalStatus}}" readonly>
