           <input type="text" value="{{customerData?.mobile}}" readonly>
         <br/>
         <label>Email Address</label>
           <input type="text" value="{{customerData?.emailAddress}}" readonly>
      </span> 
      <br/> 
      <label>SSN Number </label>  
           <input type="text" value="{{customerData?.ssnNumber}}" readonly>
      <br/><br/>
